import React from 'react';
import AppBar from '@mui/material/AppBar';
import Typography from '@mui/material/Typography';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';

import logo from './images/ezrblue_logo.png';
import './App.css';

const pages = ['How it works', 'Pricing', 'FAQs','Contact Us','About Us'];

function App() {
  const [anchorElNav, setAnchorElNav] = React.useState(null);
  const handleCloseNavMenu = () => {
    setAnchorElNav(null);
  };
  return (
    <AppBar position="static">
      <div>
      <img src={logo} className="App-logo" alt="logo" />
      </div>
      <Box sx={{ backgroundColor: "white", display: { xs: "flex" } }}>

        {pages.map((page) => (
          <MenuItem key={page} onClick={handleCloseNavMenu}>
            <Typography color="#1976d2" textAlign="center">
              {page}
            </Typography>
          </MenuItem>
        ))}

      </Box>
      <div>

         <Button  sx={{backgroundColor: "#1976d2",justifyContent : "flex-end", alignItems :"flex-end" }}><Typography color="#ffffff" textAlign="center">Login</Typography></Button>

         </div>
    </AppBar>
  );
}

export default App;
